import './App.css';
import Sidebar from './components/Sidebar';
import { BrowserRouter } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'))
root.render (
  <React.StrictMode>
    <BrowserRouter>
      <App />
      
    </BrowserRouter>
  </React.StrictMode>
)
function App() {

  return (
    <div className="App">
      
     
    </div>
  );
}

export default App;
